import React from 'react';

import Union from '../image/Union.svg'

function InfoTooltip ({onClose}) {
    return (
        <div className="popup popup__result">
            <div className="popup__container popup__container-result">
                <button className="popup__close popup__close-result" type="button"
                        onClick={onClose}>
                </button>
                <img className="popup__result_image" src={Union}/>
                <h2 className="popup__text"></h2>
            </div>
        </div>
    )
}

export default InfoTooltip;
